import { useContext } from "react"
import { TreeDataContext } from "./TreeDataContext"
import type { NodeObject, NodeId } from "./Node"

const EdgeContent = ({ id }: NodeId) => {
  const data: NodeObject[] = useContext(TreeDataContext)
  const node_data = data.find((a) => a.node_id === id)

  const sign = "&gt;"

  return (
    <>
      <div className="edge">
        {node_data!.feature} &gt; {node_data!.threshold.toFixed(2)}
      </div>
    </>
  )
}

export default EdgeContent
